import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';

class SeccionDato extends React.Component{
    render(){
        return(
            <div class="form-group row">
                <div class="col-9 text-center">
                    <select class="custom-select" id="inputGroupSelect01">
                        <option selected>Elegir sabor</option>
                        <option value="1">Dulce de leche</option>
                        <option value="2">Vainilla</option>
                        <option value="3">Frutilla</option>
                    </select>
                </div>
                <div class="col-3 text-center">
                    <div class="input-group">
                        <input type="number" class="form-control" aria-label="Amount (to the nearest dollar)">
                            <div class="input-group-append">
                                <span class="input-group-text">kg</span>
                            </div>
                        </input>
                    </div>
                </div>
            </div>
        );
    }
}

export default SeccionDato;
